leuke film voor kids

met de stemmen van Kiefer Sutherland, Dominic Scott Kay en Jonathan Kimmel

De luidruchtige leeuw Samson is de held van de dierentuin in New York. Als zijn zoon, het leeuwenwelpje Ryan, per ongeluk wordt 
verscheept naar de wildernis, moet hij in actie komen, geholpen door een vreemd gezelschap aan dieren. Samen met de gracieuze 
giraffe Bridget, de slome slang Larry, de komische koala Nigel en de eigenwijze eekhoorn Benny, gaat Samson op een gevaarlijke 
missie dwars door de jungle van New York City om Ryan te redden:
